---
- !ruby/object:NdrImport::Table
  canonical_name: two_week_wait
  filename_pattern: !ruby/regexp /.*/i
  tablename_pattern: !ruby/regexp /Data/i
  header_lines: 1
  footer_lines: 0
  klass: Hash
  columns:
  - column: monthly
    mappings:
    - field: monthly
      format: '%Y-%m-%d'
  - column: total
    mappings:
    - field: total
  - column: within standard
    rawtext_name: within_standard
    mappings:
    - field: withinstandard
  - column: outside standard
    rawtext_name: outside_standard
    mappings:
    - field: outsidestandard
  - column: performance (%)
    rawtext_name: performance_percentage
    mappings:
    - field: performance_percentage
